export default function ChecklistItem({ label, checked, onToggle }) {
  return (
    <div className="flex items-center bg-white rounded-xl shadow-md p-3 mb-2 border border-babyPink/40">
      <input
        type="checkbox"
        checked={checked}
        onChange={onToggle}
        className="h-5 w-5 text-babyBlue rounded"
      />
      <span
        className={`ml-3 ${
          checked ? "line-through text-gray-400" : "text-black"
        }`}
      >
        {label}
      </span>
    </div>
  );
}
